import React, { useRef } from "react";
import  "./Latest.css";
import song from "../../hello.wav";
import PlayCircleFilledWhiteIcon from '@mui/icons-material/PlayCircleFilledWhite';
import PauseCircleFilledIcon from '@mui/icons-material/PauseCircleFilled';
import SkipNextIcon from '@mui/icons-material/SkipNext';
import SkipPreviousIcon from '@mui/icons-material/SkipPrevious';
export default function Latest(){

    const audioElm = useRef();

    return(
        <>
           <div className="song">
                 <div class="card" style={{width:"18rem"}}>
                   <img src="..." class="card-img-top" alt="..."/>
                   <div class="card-body">
                      <h5 class="card-title">Card title</h5>
                      <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                      <audio src="https://audio-ssl.itunes.apple.com/itunes-assets/AudioPreview122/v4/db/a6/77/dba677db-5b64-0a2d-c19f-0f18d8fcc040/mzaf_10146298548367866111.plus.aac.ep.m4a" ref={audioElm} controls></audio>
                       <div className="controls">
                           <PlayCircleFilledWhiteIcon onClick={()=>{
                            audioElm.current.play();
                            }}/>
                            <PauseCircleFilledIcon onClick={()=>{audioElm.current.pause()}}/>
                           
                       </div>
                    </div>
                </div>
           </div>
        </>
    )
}
